import styled from "styled-components";
import Button from "../UI/Button";

const NewFormArea = styled.div`
    margin: 0.5rem 0;

    &label {
        display: flex;
        font-weight: bold;
        margin-top: 1.5rem;
    }

    &input {
        display: flex;
        width: 100%;
        border: 1px solid black;
        background-color: #ccc;
    }


`

const NewFormInput = () => {
 return (
    <form>
        <NewFormArea>
            <label >Username</label>
            <input type="text" />
            <label >Age (Years)</label>
            <input type="text" />
        </NewFormArea>
        <Button />
    </form>
 )
}

export default NewFormInput;
